"original": |2-
     The "multipart/byteranges" media type includes one or more body
     parts, each with its own Content-Type and Content-Range fields.  The
     required boundary parameter specifies the boundary string used to
     separate each body part.
"fixed": |-
  The "multipart/byteranges" media type includes one or more body parts, each with its own Content-Type and Content-Range fields.  The required boundary parameter specifies the boundary string used to separate each body part.
